scriptExpression.reportScript:
iif([Primary email] is null, 
		iif([Business email] is NOT null, [Business email],
			iif([Personal email] is NOT null, [Personal email],
				iif([Other email] is NOT null, [Other email],'')

				)
			)	
	, 
    iif([Primary email] = 'Business', [Business email],
        iif([Primary email] = 'Personal', [Personal email],
           iif([Primary email] = 'Other', [Other email], '')
			)
		)
	)

iif([Primary phone] is NOT null, 
	iif([Primary phone] = 'Business', [Business phone],
		iif([Primary phone] = 'Direct', [Direct phone],
			iif([Primary phone] = 'Mobile', [Mobile phone],
				iif([Primary phone] = 'Home', [Home phone],
						iif([Primary phone] = 'Other', [Other phone], '')
					)
				)
			)
		)
	, 
		iif([Business phone] is NOT null, [Business phone],
			iif([Direct phone] is NOT null, [Direct phone],
				iif([Mobile phone] is NOT null, [Mobile phone],
					iif([Home phone] is NOT null, [Home phone],
						iif([Other phone] is NOT null, [Other phone],'')
						)	
					)
				)
			)
	)

let f = convert([API Field Mapping], context())
let r = convert([API Relationship Mapping], context())
select
iif(f.[Mapped field] is not null, f.[Mapped field].Name,
iif(r.[Mapped relationship] is not null, r.[Mapped relationship].Name + iif(r.[Reverse direction],' (reverse)',''),
'') )

let f = convert([API Field Mapping], context())
let r = convert([API Relationship Mapping], context())
select
